import React from "react";
import Container from "react-bootstrap/Container";
import "../Navgation/nav.css";
import "boxicons";

const Navgation = () => {
  return (
    <nav>
      <Container>
        <div className="row">
          <div className="col-lg-8">
            <ul>
              <li></li>
              <li></li>
              <li></li>
              <li></li>
            </ul>
          </div>
        </div>
      </Container>
    </nav>
  );
};
export default Navgation;
